import React from 'react';

function User({user}){
  return(
    <div>
        <b>{user.username}</b><span>({user.email})</span>
      </div>
  )
}

function UserList() {
  const users = [
    {
      id: 1,
      username: 'kim',
      email: 'abx@naver.com'
    },
    {
      id: 2,
      username: 'park',
      email: 'zxc@gmail.com'
    },
    {
      id: 3,
      username: 'lee',
      email: 'zxczc@gmail.com'
    }
  ];
  return (
    <div>
     <User user={users[0]}/>
     <User user={users[1]}/>
     <User user={users[2]}/>
    </div>
  )
}
export default UserList;
